import React from "react";

const App = () => {
  function faireQuelqueChose() {
    console.log("Trop cool");
  }
  const faireUnetache = tache => {
    console.log("nouvelle function de " + tache);
  };
  faireUnetache("nutella");

  return <div onClick={faireQuelqueChose}>Hello</div>;
};

export default App;
